import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Button, Container } from 'react-bootstrap';

function App() {
  return (
    <Container>
    <Button bsStyle="primary">Start</Button>
    <Button bsStyle="secondary">Start</Button>
    <Button bsStyle="primary">Start</Button>
    </Container>
  );
}

export default App;
